import React from 'react';

const Home = () => {
  return (
    <div>
      <h2>Home组件内容</h2>
      <div>
        <ul className="nav nav-tabs">
          <li>
            <a className="list-group-item" href="./home-news.html">News</a>
          </li>
          <li>
            <a className="list-group-item" href="./home-message.html">Message</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
